import React, { Fragment } from 'react';
import { ListGroup, ListGroupItem, Card, Button, Col, Row, Badge } from 'react-bootstrap';
import { Activity } from '../../../app/models/Activity';

interface Props {
	activities: Activity[];
}

function ActivityList({ activities }: Props) {
	return (
		<Fragment>
			<ListGroup as="ul">
				{activities.map((activity: Activity) => (
					<ListGroupItem as="li">
						<h2>{activity.title}</h2>
						<p>
							<Badge bg="secondary">{activity.category}</Badge>
							<Badge pill bg='info'></Badge>
                            
						</p>
					</ListGroupItem>
				))}
			</ListGroup>
		</Fragment>
	);
}

export default ActivityList;
